# Default values for survey-planning-tool.
# This is a YAML-formatted file.
# Declare variables to be passed into your templates.

api:
  version: d9212b0-beta


database:
  host: postgres
  name: postgres
  port: 5432

cognito:
  host: "https://ausseabed.auth.ap-southeast-2.amazoncognito.com/"

ingress:
  certificate_arn: no_value_set

secrets:
  analytics_code: no_value_set
  auth_client_id: no_value_set
  auth_client_secret: no_value_set
  postgres_user: no_value_set
  postgres_password: no_value_set
  jwt_token_key_private: ""

